import React, { useState } from 'react';
import { WrapperDrawer } from './styled.js';
import LeftMenu from './LeftMenu';
import RightMenu from './RightMenu';
import { Button } from 'antd';

const NavBar = () => {
  const [visible, setvisible] = useState(false);

  //  const showDrawer = () => {
  //    setvisible(true);
  //  };
  const onClose = () => {
    setvisible(false);
  };
  return (
    <nav>
      {/*<div className='logo'>
        <a href=''>logo</a>
      </div>*/}
      <div style={{ display: 'flex', justifyContent: 'space-between' }}>
        <div>
          <LeftMenu />
        </div>
        <div>
          <RightMenu />
        </div>

        <WrapperDrawer
          title='Basic Drawer'
          placement='right'
          closable={false}
          onClose={onClose}
          visible={visible}>
          <LeftMenu />
          <RightMenu />
        </WrapperDrawer>
      </div>
    </nav>
  );
};

export default NavBar;
